import { useEffect, useState } from 'react';
function Homepage()  {
    const [data, setData] = useState([{}])

    useEffect(() => {
    fetch("http://127.0.0.1:5000/test").then(
      res => res.json()
    ).then(
      data => {
        setData(data);
        console.log(data);
      }
    )
  }, [])
    return <div>
        <div>
            Hello World
        </div>
    </div>
}
export default Homepage;
